def findMinimumElement(arr):
    """"""
    low = 0
    high = len(arr) - 1
    while low < high:
        mid = low + (high - low) // 2
        if arr[mid] > arr[mid + 1]:
            return arr[mid + 1]
        elif arr[mid - 1] > arr[mid]:
            return arr[mid]
        elif arr[0] <= arr[mid]:
            low = mid + 1
        else:
            high = mid - 1
    return arr[0]
